import React from 'react';
import pic from '../assets/flying_fox.png'


const About = () => {
    return(
        <div className='max-w-7xl mx-auto h-auto py-24'>
            <div className="w-11/12 mx-auto flex flex-row items-center justify-between">
                <div className="w-full h-4/5">
                    <img src={pic} alt="" className='w-80 h-full object-cover' />
                </div>
                <div className="grid place-items-center">
                    <h1 className='text-center font-potta-one text-[120px] font-normal leading-none text-[#f9f5e3]'> About Us </h1>
                    <p className='text-[] font-space-mono text-[#f9f5e3] w-3/5 text-center font-normal leading-loose mt-3'>HackTrent is the premier hackathon event hosted by Trent University. Join us for an exciting weekend of innovation, collaboration, and creativity. HackTrent offers an inclusive and inspiring environment to bring your ideas to life. Register now and be a part of the HackTrent experience!</p>
                </div>
            </div>
        </div>
    )
}

export default About;
